(394,'Inner Sleeveless Dress','<p><span>Inner Sleeveless Dress</span></p><p><br>\n</p><p><span>Inner dress turtleneck ini memberikan penutupan sempurna di area leher, menciptakan tampilan yang rapi dan nyaman. Terbuat dari bahan yang ringan dan lembut, menjaga kenyamanan sepanjang hari tanpa rasa gerah. Desainnya pas di tubuh, memberikan kenyamanan tanpa terasa ketat.</span></p><p><span>Cocok untuk pemakaian sehari-hari atau jadi pilihan tepat sebagai #TemanSafar</span></p><p><br>\n</p><p><span>Material: TENCEL Modal</span></p><p><span>Ukuran: S-M, L-XL, XXL</span></p><p><span>Warna: 4 Warna</span></p><p><br>\n</p><p><br>\n</p><p><span>Note:</span></p><p><span>- Akurasi warna 94%, tergantung resolusi dan tingkat kecerahan perangkat kamu.</span></p><p><br>\n</p><p><span>- Wajib menunjukkan bukti unboxing jika ada keluhan pada kualitas produk, kurang barang, atau kesalahan pengiriman produk.</span></p>',199000.00,'https://napocut.com/products/705115',1,'2025-12-02 21:52:07','2025-12-02 21:52:07',7),
(395,'Elara Pashmina - Pashmina Instan Premium','<p><span>Elara Pashmina</span></p><p><br>\n</p><p><span>Pashmina instan dengan inner jahit langsung, praktis tanpa perlu tambahan ciput. Desain round cutting, tidak mudah copot, dan nyaman sepanjang hari dengan bahan TENCEL Modal yang lembut &amp; adem. Cocok untuk berbagai aktivitas dan tersedia dalam 10 warna elegan. Stylish, praktis, dan tetap percaya diri seharian</span></p><p><br>\n</p><p><span>Material: TENCEL Modal</span></p><p><br>\n</p><p><span>Ukuran:</span></p><p><span>Panjang Depan: 78 cm</span></p><p><span>Panjang Belakang: 74 cm</span></p><p><br>\n</p><p><span>Warna: 10 Warna</span></p><p><br>\n</p><p><span>Note:</span></p><p><span>- Akurasi warna 94%, tergantung resolusi dan tingkat kecerahan perangkat Anda</span></p><p><span>- Wajib menunjukkan bukti unboxing jika ada keluhan pada kualitas produk, kurang barang, atau kesalahan pengiriman produk</span></p>',170000.00,'https://napocut.com/products/702705',1,'2025-12-02 21:52:12','2025-12-02 21:52:12',8),
